pragma solidity ^0.8.0;

contract YourContract {
    bool public ownershiptransferallowed;
    address public owner;
    string public name;
    string public symbol;
    uint8 public decimals;
    uint256 private totalSupply2;
    uint256 private totalSupply5;
    uint256 private totalSupply4;
    uint256 private totalSupply3;
    uint256 public minimumpayout;
    uint256 public totalsupply;
    uint256 public sellprice;
    uint256 public buyprice;
    mapping (address => uint256) public balanceof;
    mapping (address => mapping (address => uint256)) public allowance;

    constructor() payable {
        ownershiptransferallowed = false;
        name = '0';
        symbol = '0';
        decimals = 18;
        totalSupply2 = 10**uint(decimals);
        totalSupply4 = 10000 * totalSupply2;
        totalSupply5 = 0xaa4e5b2e4dc416a000;
        totalSupply3 = 4;
        minimumpayout = 0x38d7ea4c68000;
        if (msg.value == 0) {
            owner = msg.sender;
            totalsupply = 0x100000 * totalSupply2;
            balanceof[msg.sender] = totalsupply;
        }
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function save(uint256 _value) public {
        require(msg.sender == owner);
        require(_value >= minimumpayout);
        payable(owner).transfer(_value);
    }

    function setMinimumPayout(uint256 _value) public {
        require(msg.sender == owner);
        minimumpayout = _value;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= allowance[_from][msg.sender]);
        allowance[_from][msg.sender] -= _value;
        if (_value <= balanceof[_from] && _value + balanceof[_to] > balanceof[_to] && _to != address(0)) {
            balanceof[_from] -= _value;
            balanceof[_to] += _value;
        }
        return true;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        if (_value <= balanceof[msg.sender] && _value + balanceof[_to] > balanceof[_to] && _to != address(0)) {
            balanceof[msg.sender] -= _value;
            balanceof[_to] += _value;
        }
        return true;
    }

    function allowTransferOwnership(bool _value) public {
        require(msg.sender == owner);
        ownershiptransferallowed = _value;
    }

    function transferOwnership(address _newOwner) public {
        require(_newOwner != address(0));
        require(msg.sender == owner);
        require(ownershiptransferallowed);
        owner = _newOwner;
        ownershiptransferallowed = false;
    }

    function approveAndCall(address _spender, uint256 _value, bytes memory _extraData) public returns (bool success) {
        approve(_spender, _value);
        (bool success, ) = _spender.call(abi.encodeWithSignature("receiveApproval(address,uint256,bytes)", msg.sender, _value, _extraData));
        return success;
    }

    function restore(uint256 _value) public {
        require(_value >= minimumpayout);
        require(msg.sender == owner);
        balanceof[owner] -= _value;
        balanceof[address(this)] += _value;
        payable(owner).transfer(_value);
    }

    function buy() public payable {
        uint256 amount = msg.value * buyprice / totalSupply2;
        require(balanceof[address(this)] >= amount);
        balanceof[msg.sender] += amount;
        balanceof[address(this)] -= amount;
    }

    function sell(uint256 amount) public {
        require(balanceof[msg.sender] >= amount);
        uint256 etherAmount = amount * sellprice / totalSupply2;
        require(address(this).balance >= etherAmount);
        balanceof[address(this)] += amount;
        balanceof[msg.sender] -= amount;
        payable(msg.sender).transfer(etherAmount);
    }
}
